import React from 'react';
import './Content.css';
import Instruction from './Instruction.js';
import Main from './Main.js';

export default function Content({ isSubmitted }, { city1 }, { city2 }, { salary1 }, { salary2 }) {

    return (
        <div>
            {isSubmitted ? <Main /> : <Instruction city1={city1} city2={city2} salary1={salary1} salary2={salary2}/>}
        </div>
    );
}
